import React from "react";
import { useParams } from "react-router-dom";

const Bookingscreen = () => {
    let { id } = useParams();
  return (
    <div>
      <h1> Booking screen</h1>
      <h1>Room id = {id}</h1>
    </div>
  );
};

export default Bookingscreen;
